    std::transform(data.begin(), data.end(), std::back_inserter(values), [](const std::shared_ptr<int>& ptr) {
        return *ptr;
    });

    // Sort the vector of values
    std::sort(values.begin(), values.end());

    // Calculate the median
    size_t size = values.size();
